<template>
	
	<view class="wrap" >		
		<view class="bind-box">
			<view class="content">
				<view class="copy-item acea-row row-between-wrapper">
					<view class="copy-name">邀请码:</view>
					<view class="input">
					<input  disabled="" :value="my_uid"/>
					</view>
					<view class="copy-btn" @click="copy">复制</view>
				</view>
				<view class="bind-item acea-row row-between-wrapper">
					<input :disabled="code" placeholder="请输入上级的邀请码" v-model="spread_uid" />
					<view class="bind-btn" v-if="!code" @click="bind">绑定</view>
				</view>
			</view>
		</view>	
	</view>

</template>

<script>
	import {
		getBindDetail,bind
	} from '@/api/user2.js';
	export default {
		data() {
			return {
				code:'',
				my_uid:'',
				spread_uid:'',
			}
		},
		onLoad(){
			this.getBindDetail();
		},
		methods: {
			copy(){
				uni.setClipboardData({
				  data: this.my_uid,
				  success: () =>
				    uni.showToast({
				      title: '复制成功'
				    })
				})
			},
			getBindDetail(){
				getBindDetail().then(res=>{
					this.my_uid = res.user_id;
					this.spread_uid = res.spread_uid;
					this.code = res.spread_uid;
				})
			},
			bind(){
				bind(this.spread_uid).then(res=>{
					this.code = this.spread_uid;
				})
			}
		},
	}
</script>

